import Navbar from "./navbar";
import Head from "next/head";
const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>Next.js Demo</title>
        <link
          rel="stylesheet"
          href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
        />
      </Head>
      <Navbar />
      {props.children}
    </div>
  );
};

export default Layout;
